INSERT INTO `ophciexamination_drgrading_clinicalretinopathy` VALUES (1,'None','No retinopathy',1,'none',NULL,1,'1901-01-01 00:00:00',1,'1901-01-01 00:00:00','',1),(2,'Mild nonproliferative retinopathy','At least one microaneurysm',2,'mild',NULL,1,'1901-01-01 00:00:00',1,'1901-01-01 00:00:00','MN',1),(3,'Moderate nonproliferative retinopathy','Hemorrhages and/or microaneurysms &ge; standard photograph 2A*; and/or:<ul><li>soft exudates</li><li>venous beading</li><li>intraretinal microvascular abnormalities definitely present ( IRMA )</li></ul>',3,'moderate',NULL,1,'1901-01-01 00:00:00',1,'1901-01-01 00:00:00','MO',1),(4,'Severe nonproliferative retinopathy','<ul><li>Soft exudates, venous beading, and intraretinal microvascular abnormalities all definitely present in at least two of fields four through seven</li><li>or two of the preceding three lesions present in at least two of fields four through seven and hemorrhages and microaneurysms present in these four fields, equaling or exceeding standard photo 2A in at least one of them</li><li>or intraretinal microvascular abnormalities present in each of fields four through seven and equaling or exceeding standard photograph 8A in at least two of them</li></ul>',4,'severe',NULL,1,'1901-01-01 00:00:00',1,'1901-01-01 00:00:00','SR',1),(5,'Early proliferative retinopathy','Proliferative retinopathy without Diabetic Retinopathy Study high-risk characteristic:<ul><li>New vessels</li></ul>',5,'early',NULL,1,'1901-01-01 00:00:00',1,'1901-01-01 00:00:00','EP',1),(6,'High-risk proliferative retinopathy','Proliferative retinopathy with Diabetic Retinopathy Study high-risk characteristics:<ul><li>New vessels on or within one disc diameter of the optic disc (NVD) &ge; standard photograph 10A* (about one-quarter to one-third disc area), with or without vitreous or preretinal hemorrhage</li><li>vitreous and/or preretinal hemorrhage accompanied by new vessels, either NVD &lt; standard photograph 10A or new vessels elsewhere (NVE) &ge; one-quarter disc area</li></ul>',6,'high-risk',NULL,1,'1901-01-01 00:00:00',1,'1901-01-01 00:00:00','HR',1);
/*!40000 ALTER TABLE `ophciexamination_drgrading_clinicalretinopathy` ENABLE KEYS */;
