INSERT INTO `ophcotherapya_treatment` VALUES (1,1,1,1,'','Bevacizumab','1.25mg in 0.05ml every 6 weeks for 3 doses, and then when required','Intravitreal injection through the pars plana',596,2,6,2,'The patient will be followed up every 4-6 weeks and repeat injections will be given in the presence of evidence of persisting activity in the choroidal neovascular membrane. Most non AMD cases need 3 injections or less.','There have, till date, been no large prospective randomised controlled studies that have looked at the safety of intravitreal injections of Bevacizumab.\nTwo large retrospective studies have been reported.\nThe first is a single centre study done at the Department of Ophthalmology, Medical School of Athens University, Athens, Greece. Four hundred and fifty patients receiving 2,000 injections (1,275 bevacizumab and 725 ranibizumab) were followed up from 3 to 24 months and the following adverse effects were noted.\nretinal detachment 0.5%\nuveitis 1.90%, which was treated successfully and lasted not more than 12 days.\nsubconjuctival hemorrhage 10% (Patients receiving aspirin treatment were more prone to have subconjuctival hemorrhage P = 0.0002).\nThere was no statistically significant difference between the patients treated with bevacizumab or ranibizumab regarding the noted adverse events.\nREF: Safety of repeat intravitreal injections of bevacizumab versus ranibizumab: our experience after 2,000 injections. Ladas et al, Retina. 2009 Mar;29(3):313-8.\nThe second study is a retrospective, multicenter, open label, uncontrolled interventional case series of 1,173 patients who were injected with bevacizumab for diseases such as proliferative diabetic retinopathy, diabetic macular edema, retinal vein occlusions, and CNV of several etiologies including ARMD and were followed up for 12 months. A total of 4,303 intravitreal injections of bevacizumab were performed. \nAdverse Effects noted:\nSystemic adverse events were reported in 1.5% patients; these included \nacute elevation of systemic blood pressure 0.59%\ncerebrovascular accidents 0.5%\nmyocardial infarctions 0.4%\niliac artery aneurysms 0.17%\ntoe amputations 0.17%\ndeaths 0.4%\nOcular complications:\nbacterial Endophthalmitis 0.16%\ntractional retinal detachments 0.16%\nUveitis 0.09%\nrhegmatogenous retinal detachment 0.02%\nvitreous hemorrhage 0.02%\nThe study concluded Repeated intravitreal injections of bevacizumab appear to be safe and well tolerated during the 1st year.\n\n\n',1,'1901-01-01 00:00:00',1,'1901-01-01 00:00:00',1),(2,2,1,1,'','Aflibercept','2 mg monthly for initial 3 months and thereafter 2mg every two months when required','Intravitreal injection through the pars plana',0,1,0,1,'The patient will be followed up every 2 months after the first three months and repeat injections will be given in the presence of evidence of persistent activity in the choroidal neovascular membrane.In cho et al\'s study (sattached) patients required an average of 4.4. aflibercept injections (range 3-6) over 6 months. Visual acuity, clinical examination, OCT, and when necessary FFA and ICG will be carried out.','Toxicity and adverse effects similar to Ranibizumab treatment.\nRanibizumab ( REF ANCHOR / MARINA)\nEndophthalmitis:1.3% to 1.4%\nUveitis: 0.7% to 1.3%\nHypertension 6.4% to 16.3%\nNon fatal arterial thromboembolic events: 2.1%\n(MI: 1.3%\nCVA: 2.5%)',1,'1901-01-01 00:00:00',1,'1901-01-01 00:00:00',1),(4,8,3,1,'','Photodynamic therapy','TAP dose PDT with verteporfin every 3 months when required.','Intravenous infusion of Vertoprofin followed by exposure of the retina ro diode laser',2407,2,3,3,'The patient will be followed up every three months and repeat treatments will be given in the presence of evidence of persisting activity. Most patients resolve with 3 treatment cycles or less.','The following side effects were noted with an increased incidence when compared with placebo in the TAP and VIP trials. \nSystemic: mostly mild and transient.\n1. injection site reactions\n2. photosensitivity\n3. infusion related back \nOcular:\n1. Visual disturbances\n2. Acute severe visual acuity decrease  - 0.7-4.9%\nThese trials as we know evaluated the efficacy and safety of Verteporfin PDT in AMD and not CSCR/ choroidal haemangioma.\nThe prospective studies of PDT in CSCR to date have not reported any systemic or ocular adverse effects.\n',1,'1901-01-01 00:00:00',1,'1901-01-01 00:00:00',1),(5,5,2,1,'','Ranibizumab','0.5mg in 0.05ml every 4 weeks for 3 doses, and then when required','Intravitreal injection through the pars plana',1190,2,4,2,'The patient will be followed up every 4-6 weeks and repeat injection will be given in the presence of evidence of persisting activity in the choroidal neovascular membrane. Most non AMD cases need 3 injections or less','Ranibizumab ( REF ANCHOR / MARINA)\nEndophthalmitis:1.3% to 1.4%\nUveitis: 0.7% to 1.3%\nRetinal tear/vitreous haemorrhage/ lens damage 0.4%\nHypertension 6.4% to 16.3%\nNon fatal arterial thromboembolic events: 2.1%\n(MI: 1.3%\nCVA: 2.5%)',1,'1901-01-01 00:00:00',1,'1901-01-01 00:00:00',1),(6,7,4,1,'','Ozurdex','0.7 mg 1-2 per year','Intravitreal',0,2,6,3,'Ozurdex in Uveitic eyes last about 6 months. The respond would be assessed at 6 months to determine whether a second injection is required','Ocular adverse events that reached significance was and increase in pain (7.4 % vs 3.8%), ocular hypertension ( 4% vs 0.7%) and anterior chamber inflammation (1/2% vs 0%) in the implant group vs sham group respectively.\n\nThere was no increase in non-ocular side effects in the treatment group vs the sham group.',1,'1901-01-01 00:00:00',1,'1901-01-01 00:00:00',1);
/*!40000 ALTER TABLE `ophcotherapya_treatment` ENABLE KEYS */;
